//logo과 clean logo Upload.
export function Logo(){
    return(
        <a href="./">
            <img src="logo_DTCA.png" alt="이미지 업로드 오류"
            width = "150px"
            />
        </a>
    );
}

export function LogoAdd(){
    return(
        <a href="./">
            <img src="logoAdd.png" alt="이미지 업로드 오류"
            width = "150px"
            />
        </a>
    );
}
